import Navbar from './Navbar'
import Header from './Header'
import AboutCompany from './AboutCompany'
import Services from './Services'
import TechServices from './TechServices'
import Footer from './Footer'
function App() {
  return (
    <div className="App">
      <Navbar/>
      <Header/>
      <AboutCompany/>
      <Services/>
      <TechServices/>
      >
    </div>
  );
}

export default App;
